import React from 'react';
import Navbar from '../components/navbar';

function LogOut() {
    return (
        <div class="form-body">
            <div class="row">
                <div class="form-holder">
                    <div class="form-content">
                        <div class="form-items">
                             <Navbar></Navbar>
                            <h3> להתראות בנסיעה הבאה</h3>
                        </div>
                    </div>
                </div>
            </div>
        </div>
    );
};
export default LogOut;
